window.bookSummaryJSON = "<p>Destined to become a classic of adventure literature, <i>The Last Season</i> examines the extraordinary life of legendary backcountry ranger Randy Morgenson and his mysterious disappearance in California's unforgiving Sierra Nevada - mountains as perilous as they are beautiful. Eric Blehm's masterful work is a gripping detective story interwoven with the riveting biography of a complicated, original, and wholly fascinating man. </p>"; 
